import React, { useState } from "react";

const LoyaltyProgramForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    password: "",
    confirmPassword: "",
    terms: false,
  });

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prevData) => {
      if (type === "checkbox" || type === "radio") {
        return { ...prevData, [name]: checked };
      }
      return { ...prevData, [name]: value };
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <div className="loyalty-form">
      <style>{`
        .loyalty-form {
          max-width: 28rem;
          margin: 2rem auto;
          padding: 1.5rem;
          background-color: white;
          box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
          border-radius: 0.5rem;
        }
        .loyalty-form .fade-in {
          animation: fadeIn 1s ease-in-out;
        }
        .loyalty-form h1 {
          font-size: 1.5rem;
          font-weight: bold;
          color: #1F2937;
        }
        .loyalty-form p {
          color: #4B5563;
        }
        .loyalty-form input, .loyalty-form button {
          width: 100%;
          padding: 0.75rem;
          border-radius: 0.375rem;
          border: 1px solid #D1D5DB;
          margin-bottom: 1rem;
          font-size: 1rem;
        }
        .loyalty-form input:focus, .loyalty-form button:focus {
          outline: none;
          box-shadow: 0 0 0 2px #3B82F6;
        }
        .loyalty-form button {
          background-color: #3B82F6;
          color: white;
          cursor: pointer;
        }
        .loyalty-form button:hover {
          background-color: #2563EB;
        }
        .loyalty-form .terms-label {
          color: #374151;
        }
        .loyalty-form .terms-link {
          color: #3B82F6;
        }
        @keyframes fadeIn {
          from {
            opacity: 0;
          }
          to {
            opacity: 1;
          }
        }
      `}</style>

      <div className="text-center mb-6 fade-in">
        <img
          alt="Company logo"
          className="mx-auto mb-4"
          height="100"
          src="https://storage.googleapis.com/a1aa/image/C2FWOfIp0RXSO6psx17rzWz54lulIW2eA3NrM6KMlMPadK2TA.jpg"
          width="100"
        />
        <h1>Join Our Loyalty Program</h1>
        <p>Sign up to earn rewards and exclusive offers!</p>
      </div>

      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="name">Full Name</label>
          <input
            id="name"
            name="name"
            placeholder="Enter your full name"
            type="text"
            value={formData.name}
            onChange={handleInputChange}
          />
        </div>
        <div>
          <label htmlFor="email">Email Address</label>
          <input
            id="email"
            name="email"
            placeholder="Enter your email address"
            type="email"
            value={formData.email}
            onChange={handleInputChange}
          />
        </div>
        <div>
          <label htmlFor="phone">Phone Number</label>
          <input
            id="phone"
            name="phone"
            placeholder="Enter your phone number"
            type="tel"
            value={formData.phone}
            onChange={handleInputChange}
          />
        </div>
        <div>
          <label htmlFor="password">Password</label>
          <input
            id="password"
            name="password"
            placeholder="Create a password"
            type="password"
            value={formData.password}
            onChange={handleInputChange}
          />
        </div>
        <div>
          <label htmlFor="confirm-password">Confirm Password</label>
          <input
            id="confirm-password"
            name="confirmPassword"
            placeholder="Confirm your password"
            type="password"
            value={formData.confirmPassword}
            onChange={handleInputChange}
          />
        </div>
        <div className="flex items-center mb-4">
          <input
            id="terms"
            name="terms"
            type="checkbox"
            checked={formData.terms}
            onChange={handleInputChange}
          />
          <label htmlFor="terms" className="terms-label">
            I agree to the
            <a href="#" className="terms-link"> terms and conditions</a>
          </label>
        </div>
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
};

export default LoyaltyProgramForm;
